import './App.css';
import Divisores from './components/Divisores';


function App() {



  return (
    <div className="App">
      <form>
        <input type="number" id="numero" />
        <button type="submit" onClick={(e) => {
          e.preventDefault();
          var numero = document.getElementById("numero").value;
          var divisores = [];
          for (var i = 1; i <= numero; i++) {
            if (numero % i === 0) {
              divisores.push(i);
            }
          }
          console.log(divisores);
        }
        }>Calcular</button>

      </form>

      <Divisores numero={10} />
    </div>
  );
}

export default App;
